import React from 'react';

import './css/footer.css';
import FooterGraphic from '../assets/graphics/FooterGraphic.svg';
import FooterIcon from '../assets/footerIcon.svg';
import Twitter from '../assets/twitter.svg';
import LinkedIn from '../assets/linkedIn.svg';

const Footer = () => {
	return (
		<div className="footer">
			<img className="footerGraphic" src={FooterGraphic} />
			<div className="footerContainer">
				<h2 className="WhiteMainText"> Letâ€™s work together!</h2>
				<h3 className="max-width750 WhiteSecondText ">
					I have learned it doesn't matter what cool tech you get to work on or the fancy perks. I love
					designing but culture & humans trump everything! In my next role, I am looking for amazing humans to
					kickass with!
				</h3>
				<p className=" email transitionAll pointer WhiteMainText "> Matthew.Tylor.Vaccaro@gmail.com</p>
				<div className="footerCap">
					<img src={FooterIcon} />
					<div className="socialMedia">
						<a>
							<img className="pointer" src={Twitter} />
						</a>
						<a>
							<img className="pointer" src={LinkedIn} />
						</a>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Footer;
